(19, 'IBADAH JUMAT AGUNG', '2025-04-17 23:52:31', 'Hari memperingati penderitaan dan kematian Yesus Kristus di kayu salib', '2025-04-18', '2025-04-18', 'Gedung Ibadah GKS Waikabubak', '09.00 WITA', 'Ibadah dilaksanakan satu kali dengan dresscode HITAM', ''),
(20, 'MALAM REFLEKSI & PUJI PUJIAN PASKAH', '2025-04-18 00:07:52', 'Shalom seluruh Jemaat GKS Waikabubak terkasih! ?????\r\n\r\nDalam sukacita Paskah yang membahana, Komisi Pemuda GKS Waikabubak dengan bangga mengundang seluruh Bapak, Ibu, Saudara/i untuk hadir dalam:\r\n\r\n? MALAM REFLEKSI & PUJI PUJIAN PASKAH ?\r\n\r\nMari kita bersama-sama merenungkan pengorbanan Kristus yang agung dan memuliakan nama-Nya melalui lantunan pujian yang menyentuh hati.\r\n\r\n????? Hari/Tanggal: Sabtu, 19 April 2025\r\n? Waktu: Pukul 18.00 WITA (tepat waktu ya!)\r\n? Tempat: Gedung Gereja GKS Waikabubak\r\n\r\nJangan lewatkan kesempatan emas ini untuk memperdalam makna Paskah dan merasakan kebersamaan dalam kasih Kristus. Kehadiran Anda adalah sukacita bagi kami! ????\r\n\r\nAjak serta keluarga, sahabat, dan semua orang yang Anda kasihi. Sampai jumpa di Malam Refleksi & Puji Pujian Paskah! ????\r\n\r\nTuhan memberkati! ????\r\n\r\nHormat kami,\r\nKomisi Pemuda GKS Waikabubak', '2025-04-19', '2025-04-19', 'Gedung Ibadah GKS Waikabubak', '18.00 WITA Sampai selesai', '', '');
