(6, '8 Racun dalam kehidupan kita', '8 Racun dalam kehidupan kita', '2017-01-23 15:28:17', 'Budi Sudarsono', 0, '8e38ad4948ba13758683dea443fbe6be.docx', 'Umum'),
(13, 'MENGHAYATI MINGGU SENGSARA TERAKHIR YESUS KRISTUS', 'Menghayati Minggu Sengsara terakhir Yesus Kristus berarti memasuki secara rohani dan emosional pengalaman penderitaan, pergumulan, dan pengorbanan Yesus menjelang penyaliban-Nya. Ini melibatkan merenungkan peristiwa-peristiwa penting, seperti doa Yesus di Taman Getsemani, penangkapan, pengadilan yang tidak adil, siksaan, jalan salib, hingga kematian-Nya di kayu salib.\r\n\r\nMenghayati Minggu Sengsara mengajak umat percaya untuk:\r\n\r\nMerenungkan kasih Allah yang begitu besar melalui pengorbanan Kristus,\r\n\r\nMenyesali dosa yang menjadi penyebab penderitaan-Nya,\r\n\r\nMemperdalam iman dan komitmen untuk hidup sesuai dengan teladan Kristus,\r\n\r\nSerta mempersiapkan hati menyambut kemenangan kebangkitan pada Hari Paskah.', '2025-04-18 00:11:52', 'Pdt. Alfred Dj. Samani, STh, M.Si', 0, 'c8af17d90478ecbecadc8de97f9abe06.docx', NULL);
