(1, 'GKS Waikabubak', 'Solusi Informasi Teknolosi', 'L', 'admin', '@GKSwkb25', 'Solusi Informasi Teknolosi', 'bakuryuha.oor@gmail.com', '081805251993', '-', '-', '', '', 1, '1', '2020-09-03 06:07:55', '8f31ffd9a8096ec571728b8b27197a82.jpg');
INSERT INTO `tbl_pengumuman` (`pengumuman_id`, `pengumuman_judul`, `pengumuman_deskripsi`, `pengumuman_tanggal`, `pengumuman_author`, `pengumuman_gambar`) VALUES
(3, 'Pengumuman NFORMASI UPACARA PERINGATAN HARI PAHLAWAN', 'Informasi disampaikan kepada Jemaat bahwa pada hari Jumat 10 Nopember 2024 upacara peringatan Hari Pahlawan. Tidak ada senam pagi. Semua siswa memakai pakaian pramuka.  Upacara dimulai pukul 06.30 WITA. Informasi mohon disebarluaskan. Terimakasih', '2025-01-01 01:36:59', 'GKS Waikabubak', ''),
(10, 'Pengumuman', '1.	Dalam Rangka Perayaan Natal dan Tahun Baru, maka seluruh kegiatan Rutin Komisi dan PKS ditiadakan sampai dengan Minggu ke-2  Bulan Januari 2025. Demikian untuk  maklum\r\n\r\n2.	Jadwal Ibadah malam Tutup Tahun dan Tahun Baru :\r\nâ€¢	Malam Tutup Tahun, 31 Desember 2024, Jam 19.00 Wita \r\nâ€¢	Tahun Baru, 1 Januari 2025, Jam 08.30 Wita \r\n\r\n3.	Diberitahukan kepada jemaat bahwa pada ibadah Malam Tutup Tahun dan Tahun Baru, dari Polres Sumba Barat akan melakukan pemeriksaan menggunakan Metal Detector pada saat memasuki ruang ibadah, demikian untuk maklum.\r\n\r\n4.	BPMJ GKS Jemaat Waikabubak mengucapkan Terima Kasih kepada seluruh Jemaat atas partisipasi pada hari perayaan Natal dan HUT GKS Waikabubak sehingga telah terlaksana dengan baik. \r\n', '2025-01-01 01:37:05', 'GKS Waikabubak', ''),
(15, 'Pengumuman ', '1.	BPMJ GKS Jemaat Waikabubak mengucapkan terima kasih atas kerjasamanya dalam menjaga ketertiban dan keamanan dalam Perayaan Natal dan Tahun Baru, sehingga dapat berjalan dengan tertib dan aman. \r\n2.	Diberitahukan kepada seluruh jemaat bahwa Masa Vicariat an. Vic. Apriyanti Lende, STh dan Vic. Esterlina Lende, STh telah berakhir pada tanggal 31 Desember 2024, dan perpisahan akan dilaksanakan pada hari ini Minggu, 5 Januari 2025, jam 18.30 Wita selesai ibadah ke-3. \r\n3.	Diberitahukan kepada para pemanggil Wyk, ketua/Sekretaris  komisi untuk memasukkan jadwal pelayanan Rutin Komisi dan PKS. Dan kegiatan Rutin dan PKS akan diumumkan pada Minggu ke-2 bulan Januari (12 Januari 2025). Demikian untuk maklum. ', '2025-01-09 02:09:02', 'GKS Waikabubak', 'pengumuman_1736388524.png'),
(16, 'Akta Gerejawi', '1.	Pada hari ini, Minggu 5 Januari 2025 di GKS Jemaat Waikabubak Cabang Sobarade akan dilaksanakan Pengaku Dosa, dari BPK. STEPANUS BEHY dan GLORIA EVIFANIA EDO LOMI..\r\n2.	Telah masuk permohonan Baptisan Anak Orang Percaya dari keluarga YUNUS BAY LORO, anak bernama JEFRIAN LORO, dan bila tidak ada halangan permohonan tersebut akan dilaksanakan pada hari Minggu, 19 Januari 2025 di GKS Jemaat Waikabubak jam kebaktian ke-2 (09.00 Wita)\r\n3.	Telah masuk permohonan Pemberkatan Nikah dari saudara GODLIEF PUTRA WIJAYA KATU (Anggota GKS Jemaat Waikabubak) dengan saudari PUTRI LANGGA (Anggota GMIT Jemaat  Bukit Zaitun â€“ Tenau), dan bila tidak ada keberatan sah yang masuk, permohonan tersebut akan dilaksanakan pada hari Sabtu, 25 Januari 2025 di GMIT Jemaat Bukit Zaitun â€“ Tenau.', '2025-01-09 17:00:00', 'GKS Waikabubak', 'pengumuman_1736397216.png'),
(17, 'PENGUMUMAN', 'ATESTASI\r\n1.	Telah keluar Atestasi ke GKS Jemaat Manuawawi, keluarga Oktavianus Boro, beserta istri dan 2 orang anak, terhitung sejak tanggal 10 April 2025. \r\n2.	Telah masuk Atestasi dari GKS Jemaat Mata, keluarga Daud Umbu Rey, S.Si, Teol beserta istri dan 2 orang anak, terhitung sejak tanggal 12 April 2025, dan keluarga yang bersangkutan berada dalam wilayah Pelayanan Wyk Komerda.\r\n', '2025-04-12 17:00:00', 'GKS Waikabubak', 'pengumuman_1744934383.png'),
(18, 'A K T A    G E R E J A W I', '1.	Kegiatan Sidi / Pengakuan Percaya massal bagi Anak-anak SMA kelas XII, akan dilaksanakan pada hari Kamis, 17 April 2025 di GKS Jemaat Waikabubak, jam 16.00 Wita sejumlah 113  Anak . (Nama-nama terlampir)\r\n\r\n2.	Telah masuk permohonan Baptisan Anak Orang Percaya dari keluarga NGONGO DANGU KULLA Anak bernama RIFALDO LEDE KULLA, keluarga YOHANIS JONGU PEWALI, anak bernama JUANSA NISA PEWALI, dan dari keluarga YULIUS DANGU TODA, anak bernama EMARD SANJAYA DANGU,  bila tidak ada halangan permohonan tersebut akan dilaksanakan pada hari Jumat, 18 April 2025 di Cabang Watutakula. \r\n3.	Kegiatan Akta Gerejawi Massal di Cabang Modu, Jumat 18 April 2025 sebagai berikut :\r\nâ€¢	Sidi (16 Org) : ADONIRAM RINGU KANA KALE, HENDRIK KANA KALE, NOVIANA NONA INA, YULIANA MAWO WUJI, KRISTIAN TURU, YOHANIS DEGA, OKTAVIANUS WELA BILI, FRANGKIANUS BEKO, MARIA MAGDALENA BANA, ARNIA JENI LALI POTE, EPI INA KII, ORNISISI UMBU KOBA, ENJELIKA NIJA JALA, SATRIA LALI JAGA, DAN BENEDIKTUS BULU.\r\nâ€¢	Mengaku Dosa (9 Org) :  DAUD NISA DEGA, LUSIA LAKA DORO, ARNIA JENI LALI POTE, BENEDIKTUS BULU, YUBLINA BIDI BOLU, KRISTIAN TURU, NOVIANA NONA INA, YOHANIS DEGA, DAN YULIANA MAWO WUJI\r\nâ€¢	Nikah 3 (Psg) :  KRISTIAN TURU DAN NOVIANA NONA INA ; YOHANES DEGA DAN YULIANA MAWO WUJI; BENEDIKTUS BULU DAN ARNIA JENI LALI POTE\r\nâ€¢	Baptis (4 Kel / 6 org Ank) : \r\n-	Kel. KRISTIAN TURU, anak bernama NORCIAN PUTRA NONO, \r\n-	Kel. YOHANIS DEGA, anak BERNAMA GIORGINO SAPUTRA BANI\r\n-	Kel. BENEDIKTUS BULU, anak bernama JUANDRA ALFARAN BULU\r\n-	Kel. DAUD NISA DEGA, anak BERNAMA SOLEMAN SEINGU BAGA, DEVITA ELSE PEWALI DAN ALFANDI EDWIN PEWALI.\r\n4.	Kegiatan Akta Gerejawi Cabang Sobarade, Minggu 20 April 2025 sebagai berikut :\r\nâ€¢	Sidi (6 Orang) : ONESIMUS SABBA KULLA, LINCE MAGI DIALA, DAMARIS DONGU LABA MAWU, OSKAR DANGU UBA, CLARITA EFRAIM LALI PORA, dan PAULINA BARA GOLE\r\nâ€¢	Baptisan Anak Orang Percaya (3 Kel / 3 org Ank) : \r\n-	Kel. KRISTOFEL BILI, anak bernama NATALIA ELORA BILI\r\n-	Kel. YOHANIS MAWO LOBU, anak bernama GRACE ALDASANDRA LOBU\r\n-	Kel. SOLEMAN MAWU KODA, anak bernama JESLINDA RADE MAWU\r\n5.	Kegiatan Akta Gerejawi Cabang Wee Kaka, Minggu 20 April 2025 sebagai berikut :\r\nâ€¢	Sidi : OSKAR KARIAM\r\nâ€¢	Mengaku Dosa : KANIS NISA PEWALI dan APLIANA BILI\r\nâ€¢	Nikah : saudara KANIS NISA PEWALI dan APLIANA BILI\r\nâ€¢	Baptisan Anak Orang Percaya :\r\n-	Kel. KANIS NISA PEWALI, anak bernama REDAN HEASER NOPRAN PEWALI\r\n-	Kel. ISAK SOGARA BANI, anak bernama RISKI PUTRA BANI\r\n-	Kel. LEDE MUDE LALI, anak bernama FRANCA SILVIA BUNU MUDE\r\n', '2025-04-12 17:00:00', 'GKS Waikabubak', 'pengumuman_1744934498.png'),
(19, 'P E N G U M U M A N', '1.	PMK Jumat Agung dilaksanakan dengan jadwal sebagai berikut :\r\nâ€¢	Jumat, 18 April 2025 di laksanakan di Pusat (1 kali Ibadah Jam 09.00 Wita), Cabang Tawasangu, Watutakula, Modu dan Wee Kaka.\r\nâ€¢	Minggu, 20 April 2025 dilaksanakan di Cabang Sobarade, Pos PI. Lokodipuka, Iya Atem Ngadu Bonu dan Tagu Salli.\r\n2.	Dalam Rangka  Ibadah Jumat Agung,  18 April 2025, diharapkan kepada seluruh jemaat untuk mengenakan pakaian bernuansa Hitam, sedangkan dalam Ibadah Perayaan Paskah, Minggu 20 April 2025 mengenakan pakaian bernuansa Putih. Demikian untuk maklum.  \r\n3.	Dalam Ibadah ke-2  (09.00 Wita) Minggu 13 April 2025, akan diadakan Sosialisasi dan Pameran Alkitab dari Lembaga Akitab Indonesia (LAI), demikian untuk maklum. \r\n4.	Dalam Rangka Perayaan Jumat Agung dan Paskah, maka seluruh kegiatan Rutin Komisi dan PKS hari Kamis untuk minggu ini ditiadakan. Demikian untuk maklum. \r\n5.	Dalam rangka Perayaan paskah, Komisi Pemuda GKS Jemaat Waikabubak akan  mengadakan Malam Refleksi dan Puji-pujian di Halaman Gereja pada hari Sabtu, 19 April 2025 jam 17.30 Wita s/d selesai , diharapakan partisipasi dan kehadiran seluruh Jemaat. Tuhan Yesus Memberkati. \r\n6.	Kegiatan Sidi / Pengakuan Percaya Massal sbb : \r\nâ€¢	Senin dan Selasa 14 â€“ 15 April 2025, Jam, 16.00 Wita akan dilaksanakan Gladi Kotor dan Gladi Bersih\r\nâ€¢	Rabu, 16 April 2025, jam 16.00 Wita , akan dilaksanakan Kebaktian Penyerahan anak oleh Orang Tua kepada Gereja, dan dipimpin oleh Pdt. Theofilus Mete, STh\r\nDemikian untuk maklum. ', '2025-04-12 17:00:00', 'GKS Waikabubak', 'pengumuman_1744934619.png'),
(20, 'PAWAI OBOR ANAK SEKOLAH MINGGU ', 'Shalom..\r\nKomisi Anak GKS Jemaat Waikabubak mengadakan kegiatan Pawai obor pada minggu 20 April subuh jam 03.00. Rute dimulai dari Gedung  Alfa omega dan berakhir dilapangan mandaelu.\r\nMohon partisipasi dari orang tua untuk mendukung anak-Anak.\r\nTerima kasih. \r\nTuhan Yesus memberkati. ', '2025-04-19 17:00:00', 'GKS Waikabubak', 'pengumuman_1744942661.jpg'),
(21, 'PENGUMUMAN', '1.	PMK Jumat Agung hari ini Minggu, 20 April 2025 dilaksanakan di Cabang Sobarade, Pos PI. Lokodipuka, Iya Atem Ngadu Bonu dan Tagu Salli.\r\n2.	Dalam Rangka Paskah 2025, Komisi Lansia GKS Jemaat Waikabubak akan mengadakan Paskah bersama yang akan dilaksanakan pada hari Senin, 21 April 2025, Jam 10.00 Wita, bertempat di Hotel Karanu Waikabubak, dimohon kehadiran dan kebersamaan Opa, Oma Lansia dalam acara tersebut. Tuhan Yesus Memberkati.\r\n3.	Website GKS Jemaat Waikabubak https://gkswaikabubak.com; User name : jemaat@gmail.com ; Password : jemaat. Dimohon agar Warga Jemaat dapat mengakses dan mengisi Biodata Jemaat pada menu registrasi. Demikian untuk maklum. \r\n4.	Diberitahukan kepada jemaat bahwa pada hari Rabu, 23 April 2025, Pdt. Theofilus Mete, STh, Pdt. Alfred Dj. Samani, STh, Pdt. Apliyana Moto, STh dan Pdt. Nanda M. Weru, STh akan mengikuti  Workshop Tim Amandemen Tata Gereja di GKS Jemaat Wailolung â€“ Anakalang. Jam 09.00 Wita s/d selesai .  Demikian untuk maklum. \r\n', '2025-04-19 17:00:00', 'GKS Waikabubak', 'pengumuman_1745070669.jpg');
