INSERT INTO `tbl_situs` (`situs_id`, `situs_nama`, `situs_logo`, `situs_deskripsi`, `situs_favicon`, `situs_quotes`, `situs_footer`, `situs_ftpendeta`, `situs_mail`, `situs_hp`, `donasi_link`, `donasi_image`, `visi_misi`, `sambutan`) VALUES
(1, 'GKS Waikabubak', 'logo_copy.png', 'WEBSITE GKS JEMAAT WAIKABUBAK', 'LOGO_GKS_NEW.jpg', 'Jangan pernah meremehkan kekuatan doa. Dalam setiap kesulitan, percayalah bahwa Tuhan mendengar dan Dia bekerja dalam cara-Nya yang indah untuk membawa kita melalui setiap badai.', 'Hafa Digital', 'Mapen_Apli.png', 'mail@gkswaikabubak.com', '081805251993', NULL, NULL, 'VISI:\r\n\"Sumba yang Damai Sejahtera, Adil dan Bermartabat serta Terpeliharanya Keutuhan Ciptaan Tuhan.\"\r\n\r\nMISI:\r\n\"Gereja Kristen Sumba Membina, Memperlengkapi, dan Memberdayakan Pelayan dan warganya sebagai Tubuh Kristus agar mampu mewujudkan Sumba yang Damai Sejahtera, dimana masyarakat hidup sehati sepikir dan memelihara keutuhan ciptaan Tuhan\"\r\n\r\n', 'Selamat datang di GKS Waikabubak! Kami senang Anda telah bergabung dengan kami. Kami berkomitmen untuk memancarkan kasih dan terang Kristus di tengah masyarakat Waikabubak dan sekitarnya.\r\n\r\nKami berharap Anda dapat merasakan kasih dan kebaikan Allah dalam perayaan ibadah dan pelayanan di gereja ini. Kami juga berharap Anda dapat menjadi bagian dari komunitas kami dan bergabung dengan kami dalam memancarkan kasih dan terang Kristus.\r\n\r\nTerima kasih telah bergabung dengan kami! Tuhan memberkati!');
