INSERT INTO `tbl_tulisan` (`tulisan_id`, `tulisan_judul`, `tulisan_isi`, `tulisan_tanggal`, `tulisan_kategori_id`, `tulisan_kategori_nama`, `tulisan_views`, `tulisan_gambar`, `tulisan_pengguna_id`, `tulisan_author`, `tulisan_img_slider`, `tulisan_slug`) VALUES
(27, 'GKS Waikabubak Evaluasi Program Tahun 2024', '<p>Gereja Kristen Sumba (GKS) Jemaat Waikabubak menggelar rapat evaluasi kegiatan dan program tahun anggaran 2024, Rabu (16/10/2024). Rapat yang berlangsung di Aula GKS Jemaat Waikabubak ini dihadiri oleh Ketua Badan Pekerja Majelis Jemaat (BPMJ), Pendeta, Vikaris, Majelis Jemaat, serta seluruh bidang dan komisi.</p>\r\n\r\n<p>Rapat dibuka secara resmi oleh Ketua BPMJ GKS Jemaat Waikabubak, Pdt. Apliyana Moto, S.Th. Dalam sambutannya, Ia menekankan pentingnya evaluasi sebagai langkah untuk mengukur keberhasilan program yang telah dilaksanakan dan sebagai bahan pertimbangan dalam menyusun program kerja ke depan.</p>\r\n\r\n<p>Setelah pembukaan, Wakil Sekretaris BPMJ membacakan rangkuman kegiatan yang telah dilaksanakan oleh seluruh bidang dan komisi sepanjang tahun ini. Hal ini memberikan gambaran umum mengenai capaian dan tantangan yang dihadapi selama pelaksanaan program.</p>\r\n\r\n<p>Selanjutnya, Ketua BPMJ memberikan kesempatan kepada perwakilan dari setiap wilayah kelurahan, bidang, dan komisi untuk memaparkan secara rinci kegiatan yang telah mereka lakukan, progres yang telah dicapai, serta kendala yang dihadapi. Masing-masing perwakilan juga menyampaikan usulan dan masukan untuk perbaikan program di masa mendatang.</p>\r\n\r\n<p>Melalui rapat evaluasi ini, diharapkan GKS Jemaat Waikabubak dapat memperoleh gambaran yang lebih jelas mengenai kinerja seluruh bidang dan komisi. Hasil evaluasi ini akan menjadi dasar dalam menyusun rencana kerja yang lebih efektif dan efisien untuk mencapai tujuan-tujuan yang telah ditetapkan.</p>\r\n', '2024-12-10 01:03:15', 2, 'Politik', 561, 'b92e570582af84158bf134871ada5c27.jpg', 1, 'Hafa Digital', 0, 'gks-waikabubak-evaluasi-program-tahun-2024'),
(28, 'Pemuda GKS Waikabubak Gelar Lomba dan Bazar', '<p>&nbsp;Dalam rangka memperingati Hari Ulang Tahun Republik Indonesia ke-79, Komisi Pemuda Gereja Kristen Sumba (GKS) Waikabubak menggelar serangkaian kegiatan yang berlangsung meriah selama tiga hari, mulai tanggal 14 -16 Agustus 2024. Kegiatan yang dipusatkan di depan halaman gereja ini sukses menyedot perhatian banyak jemaat.</p>\r\n\r\n<p>Berbagai lomba menarik disajikan untuk memeriahkan acara ini. Pada hari pertama, anak-anak dan remaja unjuk kebolehan dalam lomba dance yang penuh semangat. Dilanjutkan pada hari kedua, suasana semakin meriah dengan perlombaan yang melibatkan komisi perempuan, komisi bapak, dan para pendeta.</p>\r\n\r\n<p>Puncak acara pada hari ketiga dimeriahkan dengan live musik dan bazar UMKM yang menampilkan produk-produk kreatif dari jemaat GKS. Selain itu, pada kesempatan ini juga dilakukan penyerahan hadiah bagi para pemenang lomba.</p>\r\n\r\n<p>Edo Supusepa, selaku koordinator kegiatan, mengungkapkan rasa syukur atas berjalannya acara dengan lancar. &quot;Kami sangat bersyukur atas antusiasme seluruh jemaat yang telah mendukung kegiatan ini. Harapan kami, kegiatan seperti ini dapat terus dilaksanakan dan menjadi wadah bagi pemuda untuk berkontribusi bagi gereja,&quot; ujarnya.</p>\r\n\r\n<p>Kegiatan yang digagas oleh Komisi Pemuda GKS Waikabubak ini tidak hanya sebagai bentuk perayaan HUT RI, tetapi juga sebagai upaya untuk mempererat tali persaudaraan antar jemaat serta mendorong semangat gotong royong. Dengan adanya kegiatan ini, diharapkan semakin banyak pemuda yang tergerak untuk menjadi tulang punggung gereja dan masyarakat.</p>\r\n\r\n<p>&nbsp;</p>\r\n', '2024-12-10 02:40:12', 13, 'Olah Raga', 697, 'ff670011a302189277d91cdbd245040b.jpeg', 1, 'Hafa Digital', 0, 'pemuda-gks-waikabubak-gelar-lomba-dan-bazar'),
(29, 'Pengukuhan Panitia Pelaksana PIAR Se-Gereja Kristen Sumba', '<p>Pada hari Minggu, 5 Mei 2024, bertempat di Gereja Kristen Sumba (GKS) Waikabubak, telah dilaksanakan pengukuhan Panitia Pelaksana Pekan Iman Anak dan Remaja (PIAR) Klasis Waikabubak. Acara ini dihadiri oleh Ketua Sinode GKS, Pdt. Marlin Lomi, S.Th., seluruh jemaat GKS Waikabubak, dan para undangan lainnya.</p>\r\n\r\n<p>Pengukuhan panitia dilakukan oleh Pdt. Marlin Lomi, S.Th. dalam kebaktian yang dimulai pukul 09.00 WIB. Nama-nama panitia yang di kukuhkan dibacakan langsung oleh Sekretaris Klasis Waikabubak, Lukas Kamodo, dan disaksikan oleh seluruh jemaat GKS Waikabubak.</p>\r\n\r\n<p>Panitia PIAR Klasis Waikabubak berjumlah 245 orang yang berasal dari seluruh jemaat di klasis Waikabubak. Pekan Iman Anak dan Remaja se-Sumba akan dilaksanakan pada tanggal 9-13 Juli 2024 di Stadion Manda Elu Waikabubak dengan jumlah peserta 1.525 orang.</p>\r\n\r\n<p>Susunan panitia PIAR Sinode ini terdiri dari beberapa bidang, yaitu:&nbsp;Penanggung Jawab: BPMS, Kepala Perwakilan Sumba Barat, BPH KOM KARSIN, BPMK Waikabubak</p>\r\n\r\n<p>Penasehat: Bupati dan Wakil Bupati Sumba Barat, Ketua DPRD Kab. Sumba Barat, Sekretaris Daerah, Pendeta se-Klasis, BP Klasis</p>\r\n\r\n<p>Ketua Umum: Drs. A.N. Dapawole</p>\r\n\r\n<p>Ketua 1: Dedy S. Ora, SE, M.Si</p>\r\n\r\n<p>Ketua 2: Samuel Dato Mesa, S.Sos</p>\r\n\r\n<p>Sekretaris 1: Lukas Kamodo</p>\r\n\r\n<p>Sekretaris 2: Yulius Sayrang</p>\r\n\r\n<p>Bendahara 1: Yuliana L.Lango</p>\r\n\r\n<p>Bendahara 2: Beby L.Noija</p>\r\n\r\n<p>Bidang-bidang PIAR Klasis Waikabubak:</p>\r\n\r\n<p>Bidang Usaha Dana: Woldeman Wello, S.Si</p>\r\n\r\n<p>Bidang Konsumsi: Ine Mira</p>\r\n\r\n<p>Bidang Acara: David Moto Lele, S.S, M.Pd</p>\r\n\r\n<p>Bidang Lomba: Vivianti Rambu</p>\r\n\r\n<p>Bidang Outbound: Agus Rihi</p>\r\n\r\n<p>Bidang Perlengkapan: Yulianus Mezango</p>\r\n\r\n<p>Bidang Dekorasi: Ros Mbakundima</p>\r\n\r\n<p>Bidang Dokumentasi: Feren Ayu Pekamila</p>\r\n\r\n<p>Bidang Humas: Jemmy Haba</p>\r\n\r\n<p>Bidang Transportasi: Yeremias Ghudi</p>\r\n\r\n<p>Bidang Keamanan: Adrianus Kadiwano</p>\r\n\r\n<p>Bidang Kesehatan: dr. Johana S. Leni Mana, Sp.PA</p>\r\n\r\n<p>Pengukuhan panitia ditutup dengan persembahan pujian &quot;Hidup Ini adalah Kesempatan&quot; dari panitia yang di kukuhkan.</p>\r\n\r\n<p>Ketua Sinode, Pdt. Marlin Lomi, S.Th., merasa terharu dan bangga dengan dikukuhkannya Panitia PIAR tahun ini karena banyak jemaat yang ikut andil dan berharap kegiatan ini dapat berjalan dengan lancar dengan diberkati oleh Tuhan Yang Maha Esa.</p>\r\n', '2024-12-10 02:49:34', 2, 'Politik', 757, '724a4c8335469176d785ba37338b6291.jpg', 1, 'Hafa Digital', 0, 'pengukuhan-panitia-pelaksana-piar-se-gereja-kristen-sumba'),
(30, 'Persekutuan Doa Kalvari GKS Rayakan Natal Bersama Keluarga Besar Lapas Waikabubak', '<p>Lembaga Pemasyarkatan (Lapas) Kelas IIB Waikabubak kembali mendapatkan kunjungan kasih dari Persekutuan Doa (PD) Kalvari yang bernaung di bawah Gereja Kristen Sumba (GKS) Waikabubak berupa acara Natal Bersama yang diselenggarakan pada Minggu 11 Desember 2022. Bertempat di halaman Gereja Lapas Waikabubak, Jemaat Kalvari yang dipimpin oleh Pendeta Charles Louis diterima langsung oleh Kepala Lapas, Yohanis Varianto bersama seluruh jajaran dan warga binaan pemasyarakatan (WBP). Natal bersama yang diselenggarakan di Lapas Waikabubak juga sekaligus merayakan 40 Tahun pelayanan PD. Kalvari di Pulau Sumba. Varianto dalam sambutannya menyampaikan rasa syukur dan terima kasih atas kunjungan Jemaat kalvari di Lapas Waikabubak. &ldquo;Keluarga Besar Lapas Waikabubak tentu merasa syukur dan berterima kasih atas kunjungan dari PD Kalvari ini. Sudah lama sekali kami tidak merayakan Natal bersama akibat pandemi. Namun di tahun ini, melalui PD Kalvari, Tuhan berkenan hadir bersama-sama dengan kami khususnya warga binaan untuk merasakan sukacita Natal,&rdquo; ungkap Varit. Sementara itu, Pdt Charles dalam khotbahnya mengajak seluruh umat yang hadir untuk menyambut kedatangan Sang Juru Selamat dengan penuh sukacita. &ldquo;Jikalau Betlehem menolak kedatangan Tuhan Yesus maka kita semua sebagai umat kesayangannya menyambut kedatanganNYA dengan penuh suka cita. Beratnya penderitaan tidak menghentikan suka cita keluarga Ibu Maria dan Bapak Yusuf bahkan kita semua dalam menyambut Natal. Suka cita yang tidak akan mati oleh waktu dan keadaan-keadaan sulit,&rdquo; jelas Pendeta Charles. Acara Natal Bersama keluarga besar Lapas Waikabubak berlangsung meriah dan diisi dengan berbagai lagu baik solo maupun vocal grup dari pegawai maupun WBP Lapas Waikabubak.***</p>\r\n', '2024-12-10 02:50:25', 5, 'Penelitian', 1415, '242ae5ca8313b915e9d6ff72146a2252.jpg', 1, 'Hafa Digital', 0, 'persekutuan-doa-kalvari-gks-rayakan-natal-bersama-keluarga-besar-lapas-waikabubak'),
(32, 'GKS Waikabubak Menggelar Lomba Pop Singer Lagu Natal', '<p>GKS Waikabubak Menggelar Lomba Pop Singer Lagu Natal</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>KBRN, Sumba :&nbsp;</strong>Menjelang Natal 2024 dan Tahun Baru 2025, Komisi Pemuda Gereja Kristen Sumba (GKS) Jemaat Waikabubak, Sumba Barat, menggelar lomba&nbsp;<em>Pop Singer</em>&nbsp;Lagu Natal bagi anak dan remaja. Kegiatan ini dijadwalkan berlangsung pada 16-17 Desember 2024 pukul 15.00 WITA di Gereja Kristen Sumba Jemaat Waikabubak.</p>\r\n\r\n<p>Eduard Supusepa, selaku ketua panitia, kepada RRI menjelaskan bahwa perlombaan ini bertujuan untuk menggali dan meningkatkan talenta anak-anak serta remaja Jemaat GKS Waikabubak dalam bidang tarik suara. Selain itu, acara ini diharapkan dapat membangun kedekatan emosional antar anak dan pemuda di berbagai cabang dan Pos Pekabaran Injil (PI) yang berada di bawah naungan GKS Waikabubak.</p>\r\n\r\n<p>Persiapan kegiatan ini telah mencapai 90 persen, termasuk dekorasi dan pernak-pernik Natal yang sudah lengkap. Pada Sabtu, 14 Desember 2024, panitia pemuda telah mengadakan&nbsp;<em>technical meeting</em>&nbsp;bersama dewan juri untuk memastikan kesiapan teknis pelaksanaan lomba, termasuk persiapan MIDI lagu-lagu yang akan dilombakan.</p>\r\n\r\n<p>Panitia menargetkan 20 peserta untuk setiap kategori. Saat ini, kategori anak telah melebihi target dengan 24 peserta, sedangkan kategori remaja baru diikuti oleh 15 peserta. Komisi Pemuda GKS Waikabubak berharap lebih banyak pemuda yang belum terlibat agar turut berpartisipasi dalam kegiatan positif ini untuk berbagi, belajar, dan bertumbuh bersama.</p>\r\n\r\n<p>Saat ditanya mengenai keterlibatan jemaat GKS lainnya di Kota Waikabubak atau daratan Sumba, Eduard menjelaskan bahwa perlombaan ini masih terbatas pada internal GKS Waikabubak, termasuk cabang dan Pos PI. Namun, pihaknya berencana untuk melibatkan GKS dari wilayah lain pada penyelenggaraan di masa mendatang.</p>\r\n\r\n<p>Dengan adanya perlombaan ini, diharapkan anak-anak dan remaja GKS Waikabubak dapat mengembangkan talenta serta mempererat kebersamaan menjelang momen Natal dan Tahun Baru.&nbsp;<strong>(JL/AN)</strong></p>\r\n', '2024-12-27 15:06:49', 6, 'Prestasi', 1440, '9885af9fa262efc740206497e24b3932.jpeg', 1, 'Hafa Digital', 0, 'gks-waikabubak-menggelar-lomba-pop-singer-lagu-natal'),
(33, 'GKS Waikabubak Rayakan Natal dan HUT ke-87 Meriah', '<p>KBRN, Sumba :&nbsp; Perayaan Natal di Gereja Kristen Sumba (GKS) Jemaat Waikabubak tahun ini terasa istimewa karena bersamaan dengan peringatan Hari Ulang Tahun (HUT) ke-87 gereja tersebut. Acara yang berlangsung pada 25 Desember 2024 ini menjadi momen bersejarah sekaligus penuh makna bagi umat Kristiani di Sumba Barat.</p>\r\n\r\n<p>Ketua panitia penyelenggara, Drs. Agustinus Niga Dapawole, menyebutkan bahwa usia 87 tahun mencerminkan perjalanan panjang GKS Jemaat Waikabubak dalam mengabarkan Injil dan membina jemaat di Pulau Sumba. &quot;Gereja ini telah menjadi tempat lahirnya banyak jemaat dan pemimpin gereja yang tersebar di berbagai wilayah Sumba,&quot; ungkapnya.</p>\r\n\r\n<p>Dengan mengusung tema kasih dan persaudaraan, perayaan ini tidak hanya menjadi acara seremonial, tetapi juga momentum untuk mempererat persaudaraan dan berbagi kasih di antara jemaat. Agustinus menegaskan, &ldquo;Perayaan ini adalah wujud nyata kasih Kristus yang hidup dalam setiap jemaat.&rdquo;</p>\r\n\r\n<p>Perjalanan panjang GKS Jemaat Waikabubak yang telah berdiri kokoh selama 87 tahun menjadi inspirasi bagi umat untuk terus melayani. Gereja ini telah membuktikan perannya, tidak hanya dalam membangun iman jemaat, tetapi juga mempererat komunitas di Sumba Barat.</p>\r\n\r\n<p>Acara ini diisi dengan berbagai kegiatan rohani, seperti ibadah syukur, pujian, dan salam kasih antarjemaat. Suasana penuh kehangatan dan sukacita menyelimuti seluruh rangkaian kegiatan, mencerminkan semangat kebersamaan dan cinta kasih yang mendalam.</p>\r\n\r\n<p>Dalam sambutannya, Agustinus juga berpesan kepada generasi muda agar meneruskan semangat pelayanan gereja. &ldquo;Kita semua dipanggil untuk menjaga warisan iman ini dan mewariskannya kepada anak cucu kita,&rdquo; katanya.</p>\r\n\r\n<p>Perayaan Natal dan HUT ke-87 GKS Cabang Waikabubak ini menjadi simbol kekuatan iman, persatuan, dan semangat kasih bagi umat Kristiani di Pulau Sumba. Dengan keyakinan dan komitmen yang teguh, gereja ini akan terus melangkah maju dalam pelayanan bagi jemaat dan masyarakat sekitar. (JL)</p>\r\n', '2024-12-27 15:08:01', 2, 'Politik', 1499, '0a5659f5a84f6959583782aad05e4286.jpeg', 1, 'Hafa Digital', 0, 'gks-waikabubak-rayakan-natal-dan-hut-ke-87-meriah');
